import React, {Component} from 'react';
import {connect } from 'react-redux'
import Popup from "reactjs-popup";

class CountDownAddEntityButton extends Component
{
    render()
    {
        return(
            <Popup
            
            trigger={<button style={{position:"absolute",left:(this.props.resources.length*50+50)}}className="button">+</button>}
            modal
            closeOnDocumentClick>
           <form onSubmit={this.handleSubmit}>
                <label >
                    Mission Title:
                    <input type="text" name="title" onChange={this.handleChange} />
                </label>
                 <input type="submit" value="Submit" /> 
            </form>  
        
          </Popup>
        )
    }
}


const mapStateToProps = (state)=> ({
    resources: state.CountDownlists.resources,
   
  })

export default connect(mapStateToProps)(CountDownAddEntityButton)
